    def test_something(self):
        for agents in CopyTest.multiple_agents:
            deepcopy = copy.deepcopy(agents)
            for i in range(len(agents)):
                for key in agents[i]:
                    self.assertTrue(key in deepcopy[i])
                for key in deepcopy[i]:
                    self.assertTrue(key in agents[i])
                self.assertEqual(len(agents[i]), len(deepcopy[i]))


    def test_single_agent(self):
        for agents in CopyTest.multiple_agents:
            for i in range(len(agents)):
                deepcopy = copy.deepcopy(agents[i])
                for key in agents[i]:
                    self.assertTrue(key in deepcopy)
                for key in deepcopy:
                    self.assertTrue(key in agents[i])
                self.assertEqual(len(agents[i]),len(deepcopy))


    def test_time_deepcopy(self):
        start = datetime.now()
        for i in range(1000):
            for agents in CopyTest.multiple_agents:
                deepcopy = copy.copy(agents)
                deepcopy = deepcopy
        end = datetime.now()
        print(str(end - start))

    def test_copy_deepcopy(self):
        fst_agent = CopyTest.multiple_agents[0][0]
        sec_agent = copy.deepcopy(fst_agent)
        third_agent = copy.copy(fst_agent)
        fourth_agent = fst_agent

        fst_agent.update({0: 0})
        third_agent.update({1: 1})
        print("\n")
        print(fst_agent)
        print(sec_agent)
        print(third_agent)
        print(fourth_agent)



